import React from 'react';
import './fonts.css';
import {Header} from './AppStyled'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAppleAlt, faAppleWhole, faCoffee, faEnvelope,} from "@fortawesome/free-solid-svg-icons";

function App() {

  return (

    <div>
      <Header>

      <FontAwesomeIcon style={{color:'white'}} icon={faAppleAlt} />      

      </Header>

    </div> 
  );
}

export default App;
